import HeaderBtnGreen from "./HeaderBtnGreen";

function Navbar(){
    return (
        <div className="nav">
            <Caption send="send" freight="FREIGHT" />

            <SearchBar/>

            <div className="">
                <HeaderBtn  text="Request Quote"/>
                <HeaderBtnGreen text="Book Shipment" />
            </div>
        </div>
    )
}

export default Navbar;
